import configViewEngine from './configs/viewEngine';
import initWebRoute from './route/web';

require('dotenv').config();

const app = express()
const port = process.env.PORT || 8080;

// set up view engine
configViewEngine(app);

// init web route
initWebRoute(app);


app.listen(port, () => {
    console.log(`Server listening on port ${port}`)
})

